RGB_tstrPixelData vidGetPixel(u8 Driver, u32 u32pixelNo)
{
   /**
    * \DESIGNER_START Define Function activity diagram \DESIGNER_END
    * @startuml
    * title Function activity diagram
    * start */

   /**: Initialize RGB Pixel colors ;*/
   RGB_tstrPixelData loc_enupixel = {0,0,0} ;

#if (LP5891_IMAGEKEY_FEATURE == LP5891_FEATURE_ON)
   u32 loc_pixelindex = (LP5891_u32STARTKEY_INDEX +(u32) 1 ) + (u32)3 * u32pixelNo  ;
#else 
   u32 loc_pixelindex =  (u32)3 * u32pixelNo  ;
#endif

   /**: Get RGB Pixel colors ;*/
   loc_enupixel.LED_REDx.u16Word = LP5891_au16ImageLocation[Driver][loc_pixelindex] ;
   loc_enupixel.LED_GREENx.u16Word = LP5891_au16ImageLocation[Driver][loc_pixelindex+1] ;
   loc_enupixel.LED_BLUEx.u16Word = LP5891_au16ImageLocation[Driver][loc_pixelindex+2] ; 
   
   /**: Return status ;*/
   return loc_enupixel ;
   /** stop*/
   /** @enduml*/
}






